import './App.css';

function App() {

  let data=["Adfar","Adfar Rashid","React","Javascript"]
  return (
    <div className="App">
      {data.map((item,index)=>{
        return(
          <ul>
            <li key={index}>{item}</li>
          </ul>
        )
      })}
    </div>
  );
}

export default App;
